gIW(){return"\u2022 Desarrollo \xe1gil full stack en Java, Flutter, Python, Svelte, y SQL\n\u2022 Dise\xf1\xf3, desarroll\xf3 e imparti\xf3 importantes secciones de VisaGO - la primera aplicaci\xf3n Visa con emisi\xf3n digital dirigida directamente al consumidor y la primera en lograr m\xe1s de 150.000 descargas en 90 d\xedas\n\u2022 Integraci\xf3n con ChatGPT en m\xfaltiples proyectos internos para agilizar los flujos de trabajo de otros equipos"},
